      <text id="41" justification="0" size="4" underlined="false">
        <text>Memoized value uses RootNode to check

FileModificationService to get the value.</text>
      </text>

      <text id="47" justification="0" size="4" underlined="false">
        <text>Any class can get hold of a MemoizedFile

      </text>
      <color reference="42"/>

      <textColor reference="8"/>
      <text id="52" justification="0" size="4" underlined="false">
        <text>2 use cases for File modification services:
- Memoized value
- Classes listing files etc.
We need to make sure the following is possible:
- we can replace the FileModificationService during runtime
- The FIleModificationService is the only thing responsible
for looking on disk
- Tests shouldnt have to wait for changes to be discovered
</text>
      </text>
      <color reference="42"/>
    </NoteNode>

      <textColor reference="8"/>
      <text id="57" justification="0" size="4" underlined="false">
        <text>How many file modification services do we need?
- Java7FileModificationService
 - uses the Java7 file watcher API
- StandardFileModificationService
 - assumes files havent changed unless there is a
&apos;resetLastModified&apos; event for a Node</text>
